NodeJS / PassportJS [local] - Is there a way to update req.user automatically?<p>Good morning,</p>
<p>I am currently studying beginner courses online using NodeJS, Passport, MongoDB (+Mongoose) and implementing sign up, login, changing details etc.</p>
<p>While implementing edit profile page which allows users to change their name, email address and profile picture, I have noticed that my req.user does not get updated while the course I am watching says that Passport should handle it automatically and his video evidently does so.</p>
<p>The changes I enter is successfully reflected in MongoDB, which I can see from typing db.users.find({}) in mongo but my req.user object doesn't get updated so my pages still render the old name, email and profile picture <strong>until</strong> I logout and log back in.</p>
<p>I have worked around it by manually updating req.user as per the code below but I was wondering why my codes behave differently to the videos I am watching. Any guidance will be very appreciated.</p>
<pre><code>//from the controller
export const postEditProfile = async (req, res) =&gt; {
  const {
    body: { name, email },
    file,
  } = req;
  try {
    await User.findByIdAndUpdate(req.user._id, {
      name,
      email,
      avatarUrl: file ? file.path : req.user.avatarUrl,
    });
    console.log(req.user);  //shows old db information
    req.user.name = name;
    req.user.email = email;
    req.user.avatarUrl = file ? file.path : req.user.avatarUrl;
    res.redirect(routes.me);
    console.log(req.user); //shows new db information
  } catch (error) {
    res.render(&quot;editProfile&quot;, { pageTitle: &quot;Edit Profile&quot; });
  }
};
</code></pre>
<pre><code>//serializing and deserialzing
passport.serializeUser((user, done) =&gt; {
  done(null, user);
});

passport.deserializeUser((obj, done) =&gt; {
  done(null, obj);
});
</code></pre>
<p>Thank you!</p>

