Sorting by relevance in MongoDB aggregation framework using multiple fields<p>I have a Node/NestJS backend application that uses MongoDB (with the Mongoose driver). For a &quot;Get&quot; function, I have set up an aggregation pipeline where first some &quot;hard&quot; filters can be applied, which filters out content entirely - and now I want some soft filters, which ranks search results and filters them out if they are irrelevant. This algorithm should use three fields on the document: title, description and tags. The title and the tags should have the most weight of those. Results would be excluded if the total relevance score falls below a certain threshold. Now, I have checked several other StackOverflow posts for this, for example <a href="https://stackoverflow.com/questions/12770673/sorting-by-relevance-with-mongodb">this one</a>, but they all seem to be about the &quot;tags&quot; field alone. A piece of doc I found <a href="https://docs.mongodb.com/manual/tutorial/control-results-of-text-search/" rel="nofollow noreferrer">suggested to use indexes for this</a>, but I preferably want to do it through the aggregation framework, if I knew approximately how to do it.</p>
<p>Below is code from another application that demonstrates the functionality;</p>
<pre><code>        do {
          let reg
          if (Array.isArray(searchString)) {
            reg = new RegExp(searchString[i], 'gi')
          } else {
            reg = new RegExp(searchString, 'gi')
          }
          for (const note of this.notes) {
            const countTitle = (note.title.match(reg) || []).length
            note.searchScore += countTitle

            let countTags = 0

            for (const tag of note.tags) {
              const tagLength = (tag.match(reg) || []).length
              countTags += tagLength
            }

            note.searchScore += countTags * 0.5

            const countContent = (note.content.match(reg) || []).length

            note.searchScore += countContent * 0.3
          }
          i++
        } while (!Array.isArray(searchString) &amp;&amp; i &lt; searchString.length)
        this.toDisplay = this.notes.filter(
          f =&gt; f.searchScore &gt; 0 + searchString.length / 4
        )
        this.showNew = false
        this.sortUp = false
        this.sortItems('relevance')
      } else {
        this.updateUI()
      }
    }
</code></pre>
<p>The algorithm above takes a string or array of strings. Title, tags and description/content have weights of 1, 0.5 and 0.3 respective. A threshold is set where items are filtered out entirely when score is lower or equal to 0 + the amount of search terms divided by 4. The values can be adjusted, but in essence, this is the algorithm I want to implement within the aggregate framework. How would it kind of look like? Thanks in advance.</p>

