Change Date format to MM-DD-YYY<p>I've been searching for a fix on this, seems like it should be something fairly simple.</p>
<p>I have a page showing data from a MongoDB.  Collection name is tickets and the field is ticketDate.</p>
<pre><code>import { Link, useParams } from &quot;react-router-dom&quot;;
import { Col, Row, Container } from &quot;../Grid&quot;;
import Jumbotron from &quot;../Jumbotron&quot;;
import API from &quot;../../utils/API&quot;;

function TicketDetails(props) {
  const [tickets, setTickets] = useState({})

  // When this component mounts, grab the ticket with the _id of props.match.params.id
  // e.g. localhost:3000/Tickets/599dcb67f0f16317844583fc
  const {id} = useParams()
  useEffect(() =&gt; {
    API.getTicket(id)
      .then(res =&gt; setTickets(res.data))
      .catch(err =&gt; console.log(err));
  }, [id])

  return (
    &lt;Container fluid&gt;
      &lt;Row&gt;
        &lt;Col size=&quot;md-12&quot;&gt;
          &lt;Jumbotron&gt;
            &lt;h1&gt;
            &lt;strong&gt;
              Ticket # - {tickets.ticketNum}                      
            &lt;/strong&gt;
            &lt;/h1&gt;
