mongodb $lookup for nested object in array with projection<p>I'm having a problem using $lookup in my aggregation pipeline.</p>
<p>I have 2 collections, <code>members</code> &amp; <code>messages</code></p>
<p>members :</p>
<pre><code>{_id, FirstName, LastName, Email, ...}
</code></pre>
<p>messages</p>
<pre><code>{
  _id:ObjectId('xxx'),
  createdBy:ObjectId(''),
  ...
  threads:[
    {  message:'' , attachments:[] , from:ObjectId , to:[{status:'Read' , recipient:ObjectId}] }]
}
</code></pre>
<p>What I'm trying to do is,</p>
<p>lookup for each recipient in : <code>to:[{status:'Read' , recipient:ObjectId}]</code> and populate name and email from members collection.</p>
<p>I tried many different things like this one;
//</p>
<pre><code>db.messages.aggregate([
     {
                '$lookup': {
                    'from': 'members',
                    'let': {
                        'memberId': '$threads.to.recipient'
                    },
                    'pipeline': [
                        {
                            '$match': {
                                '$expr': {
                                    '$eq': [
                                        '$$memberId', '$members._id'
                                    ]
                                }
                            }
                        },
                        {$project: {FirstName: 1, _id: 1, LastName: 1, Email: 1}}
                    ],
                    'as': 'members'
                }
            }
    ]
</code></pre>
<blockquote>
<p>Many different queries including this one always return [] for members ('as': 'members').</p>
</blockquote>
<p>Just to test I tired with mongoose and .populate('threads.to.recipient','FirstName') worked perfectly. But I cannot use mongoose for this I have to use MongoDB's native nodejs driver.</p>
<p>any advice would be greatly appreciated on this...</p>

