<p>As we noticed that this output could be difficult to read in the future, we've decided to change the model to this:</p>
<pre><code>public class Response implements Serializable {
    //...
    private Map&lt;String,Object&gt; errorBody;
    //...
}
</code></pre>
<p>The data are now saved like so:</p>
<pre><code>&quot;response&quot;: {
  ...
        &quot;errorBody&quot;: {
          &quot;code&quot;: &quot;Error code value&quot;,
          &quot;message&quot;: &quot;Error message value&quot;,
          &quot;description&quot;: &quot;Error description value&quot;,
          ...
        },
  ...
 }
</code></pre>
<p>Which, as you may have noticed is pretty much more simple.</p>
<p>When reading the data, ex: <code>repository.findAll()</code></p>
<p>The new format is read without any issue.</p>
<p>But we face these issues with the old format:</p>
<p><code>org.springframework.data.mapping.MappingException: No property v found on entity class com.fasterxml.jackson.databind.node.TextNode to bind constructor parameter to! </code></p>
<p>Or</p>
<p><code>org.springframework.data.mapping.model.MappingInstantiationException: Failed to instantiate com.fasterxml.jackson.databind.node.ObjectNode using constructor NO_CONSTRUCTOR with arguments</code></p>
<p>Of course the <code>TextNode</code> class has a constructor with <code>v</code> as param but the property name is <code>_value</code> and <code>ObjectNode</code> has no default constructor: We simply can't change that.</p>
<p>We've created custom converters that we've added to our configurations.</p>
<pre><code>public class ObjectNodeWriteConverter implements Converter&lt;ObjectNode, DBObject&gt; {    
    @Override
    public DBObject convert(ObjectNode source) {
        return BasicDBObject.parse(source.toString());
    }
}
</code></pre>
<pre><code>public class ObjectNodeReadConverter implements Converter&lt;DBObject, ObjectNode&gt; {
    @Override
    public ObjectNode convert(DBObject source) {
        try {
            return new ObjectMapper().readValue(source.toString(), ObjectNode.class);
        } catch (IOException e) {
            throw new UncheckedIOException(e);
        }
    }
}
</code></pre>
<p>We did the same for <code>TextNode</code></p>
<p>But we still got the errors.</p>
<p>The converters are read as we have a <code>ZonedDateTimeConverter</code> that is doing his job.</p>
<p>We can not just wipe out or ignore the old data as we need to read them too in order to study them.</p>
<p>How can we set up a custom reader that will not fail reading the old format ?</p>; Answer: The reason is because filtering load the file and check the content inside it, the simple way is disable filtering if not required or better add special **exclusion pattern** with tag 

`<nonFilteredFileExtensions>
            <nonFilteredFileExtension>jks</nonFilteredFileExtension>
</nonFilteredFileExtensions>`

reference: [maven doc](https://maven.apache.org/plugins/maven-resources-plugin/examples/binaries-filtering.html) or for a more generic filter approach: [maven doc](https://maven.apache.org/plugins/maven-resources-plugin/examples/filter.html)

